import { CommonModule } from "@angular/common";
import { Component, Inject } from "@angular/core";
import { FormsModule, ReactiveFormsModule } from "@angular/forms";
import {
    MessageService,
} from "primeng/api";
import { BadgeModule } from "primeng/badge";
import { ButtonModule } from "primeng/button";
import { PRIME_NG_CONFIG, PrimeNGConfigType } from "primeng/config";
import { FileUploadModule } from "primeng/fileupload";
import { ToastModule } from "primeng/toast";

@Component({
    selector: "p-file-upload",
    imports: [
        CommonModule,
        ToastModule,
        FormsModule,
        ReactiveFormsModule,
        ButtonModule,
        FileUploadModule,
        BadgeModule

    ],
    templateUrl: "./file-upload.component.html",
    standalone: true,
})
export class FileUploadComponent {
    files = [];

    totalSize: number = 0;

    totalSizePercent: number = 0;

    constructor(
        @Inject(PRIME_NG_CONFIG) private config: PrimeNGConfigType,
        private messageService: MessageService,
    ) {}

    choose(event: any, callback: any) {
        callback();
    }

    onRemoveTemplatingFile(
        event: any,
        file: any,
        removeFileCallback: any,
        index: any,
    ) {
        removeFileCallback(event, index);
        this.totalSize -= parseInt(this.formatSize(file.size));
        this.totalSizePercent = this.totalSize / 10;
    }

    onClearTemplatingUpload(clear: any) {
        clear();
        this.totalSize = 0;
        this.totalSizePercent = 0;
    }

    onTemplatedUpload() {
        this.messageService.add({
            severity: "info",
            summary: "Success",
            detail: "File Uploaded",
            life: 3000,
        });
    }

    onSelectedFiles(event: any) {
        this.files = event.currentFiles;
        this.files.forEach((file: any) => {
            this.totalSize += parseInt(this.formatSize(file.size));
        });
        this.totalSizePercent = this.totalSize / 10;
    }

    uploadEvent(callback: any) {
        callback();
    }

    formatSize(bytes: any) {
        const k = 1024;
        const dm = 3;
        const sizes = this.config.translation?.fileSizeTypes as any;
        if (bytes === 0) {
            return `0 ${sizes[0]}`;
        }

        const i = Math.floor(Math.log(bytes) / Math.log(k));
        const formattedSize = parseFloat((bytes / Math.pow(k, i)).toFixed(dm));

        return `${formattedSize} ${sizes[i]}`;
    }
}

import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';
import { Component, ViewChild } from '@angular/core';

import { InputTextModule } from 'primeng/inputtext';
import { MenuModule } from 'primeng/menu';
import { IconFieldModule } from 'primeng/iconfield';
import { InputIconModule } from 'primeng/inputicon';

import { LeftMenuComponent } from '../left-menu/left-menu.component';

import { Menu, MenuItem } from '../left-menu/menu.model';
import { UserMenuItems } from './user-menu.model';

@Component({
  selector: 'numo-header',
  standalone: true,
  imports: [
    FormsModule,
    CommonModule,
    InputTextModule,
    MenuModule,
    LeftMenuComponent,
    IconFieldModule,
    InputIconModule,
  ],
  templateUrl: './header.template.html',
})
export class HeaderComponent {
  isMenuVisible = false;

  @ViewChild('leftMenu') leftMenu: any;
  @ViewChild('userMenu') userMenu: any; // Reference to user menu
  items: MenuItem[] = [...Menu];
  userMenuItems = [...UserMenuItems]; // Use the imported user menu items

  toggleMenu(event: Event) {
    this.isMenuVisible = !this.isMenuVisible;

    // Get the element by ID
    const leftMenu = document.getElementById('left-menu');

    if (leftMenu) {
      // Toggle the class on the element with ID "left-menu"
      if (this.isMenuVisible) {
        leftMenu.classList.add('left-[15px]');
        document
          .getElementById('content_holder')
          ?.classList.add('lg:pl-[285px]');
      } else {
        leftMenu.classList.remove('left-[15px]');
        document
          .getElementById('content_holder')
          ?.classList.remove('lg:pl-[285px]');
      }
    }
  }

  showUserMenu(event: Event) {
    this.userMenu.toggle(event); // Show the user menu
  }
}

